import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-primary bg-primary">
    <a className="navbar-brand" href="/">
        <h2 className="text-white">Google Book Search</h2>
    </a>
    <div id="navbarNav">
        <ul className="navbar-nav">
            <li className="nav-item" id="home">
               className="nav-link" href="/"><button type="button" className="btn btn-info text-white">Search Books</button>
            </li>
            <li className="nav-item" id="report">
               className="nav-link" href="/saved"><button type="button" className="btn btn-warning text-white">Saved Books</button>
            </li>
        </ul>
    </div>
</nav>

  );
}




export default Nav;
